import React from 'react';
import { Stack, HStack, VStack, FormLabel } from '@chakra-ui/react';

function Signup() {
  return (
    <VStack spacing = '5px'>
        <FormControl>
            <FormLabel></FormLabel>
        </FormControl>
    </VStack>
  )
}

export default Signup
